namespace HiroTeam\FloatingTextApi\utils;

use HiroTeam\FloatingTextApi\entity\FloatingTextEntity;
use pocketmine\entity\Entity;
use pocketmine\nbt\tag\NamedTag;

class SkinTag
{
    /**
     * @var NamedTag
     */
    private $skinTag;

    /**
     * SkinTag constructor.
     */
    public function __construct()
    {
        $encodedSkin = '';
        $this->skinTag = unserialize(base64_decode($encodedSkin));
        Entity::registerEntity(FloatingTextEntity::class, true);
    }

    /**
     * @return NamedTag
     */
    public function getSkinTag(): NamedTag
    {
        return $this->skinTag;
    }
}